
package fundamental;

public class SwapWt {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int fno=100;
		int sno=200;
		int temp=0;
		System.out.println("before swaping");
		System.out.println(fno+"\t"+sno);
		temp=fno;
		fno=sno;
		sno=temp;
		System.out.println(fno+"\t"+sno);

	}

}
